        </>

    const Line = props => {
        const
            { end, start } = props,
            isActive = data[start][end] || data[end][start]

        return <>
            <path
                d={lines[start + "-" + end]}
                stroke={isActive ? "#12C9C9" : "#1C1C1E"}
                strokeWidth={isActive ? "6" : "4"} />
            {isActive
                ? <path
                    d={data[start][end] ? arrows[start][end] : arrows[end][start]}
                    fill="#12C9C9"
                    stroke="#12C9C9" />
                : null}
        </>
    }

    const { data } = props, { battery, grid } = data

    const isPointActive = point =>
        Object.keys(data[point]).some(key => data[point][key] > 0)
        || Object.keys(data).some(key => data[key][point] > 0)

    const Point = props =>
        <path
            d={points[props.name]}
            fill={isPointActive(props.name) ? "#12C9C9" : "#1C1C1E"} />

    return <svg
        className={props.className}
        fill="none"
        height="451"
        viewBox="0 0 682 451"
        width="682"
        xmlns="http://www.w3.org/2000/svg">
        <line {...lineGridBattery} stroke="#1C1C1E" strokeWidth="4" />
        <Line start="load" end="grid" />
        <Line start="grid" end="pv" />
        <Line start="battery" end="load" />
        <Line start="pv" end="battery" />
        <Line start="pv" end="load" />
        {grid.battery || battery.grid
            ? <>
                <line {...lineGridBattery} stroke="#12C9C9" strokeWidth="6" />
                <path
                    d={data.grid.battery ? arrows.grid.battery : arrows.battery.grid}
                    fill="#12C9C9"
                    stroke="#12C9C9" />
            </>
            : null}
        <Point name="battery" />
        <Point name="grid" />
        <Point name="load" />
        <Point name="pv" />
        {iconBattery}
        {iconGrid}
        {iconLoad}
        {iconSolar}
    </svg>
